import React, { SFC } from 'react';

export interface AlertProps {
   abc: string;
};

const Alert: SFC<AlertProps> = (props) => {
  return (<div>{props.children}</div>);
};

export {Alert};
try {
    // @ts-ignore
    Alert.displayName = "Alert";
    // @ts-ignore
    Alert.__docgenInfo = { "description": "", "displayName": "Alert", "props": { "abc": { "defaultValue": null, "description": "", "name": "abc", "required": true, "type": { "name": "string" } } } };
    // @ts-ignore
    if (typeof STORYBOOK_REACT_CLASSES !== "undefined")
        // @ts-ignore
        STORYBOOK_REACT_CLASSES["src/demo/Alert.tsx#Alert"] = { docgenInfo: Alert.__docgenInfo, name: "Alert", path: "src/demo/Alert.tsx#Alert" };
}
catch (__react_docgen_typescript_loader_error) { }
